calculateNextP.body:
if(k == 0) return 0;

p = p * Math.pow(10, 6); // Raise p to 10^6
k = k * Math.pow(10, 8); // Raise k to 10^8
var dP = r * p * (1 - p / k);
dP /= stepsPerHour;
return (p + dP) / Math.pow(10, 6); // Bring p back by 10^6

fillInZeros.body:
return _.map(_.range(length), function(i) {
    if(i < inputArray.length) return inputArray[i] / 100;
    return null;
});

makeXLabels.body:
return _.map(_.range(hourCount * stepsPerHour), function(x) { 
    //return x % stepsPerHour == 0 ? x / stepsPerHour : "";
    return "";
});

prepareCandies.body:
// Assign an asset, and scale the candy position to steps and 10x8 
return _.map(candies, function(candy) {
    return {
        asset: "candyBW.png",
        position: [candy.position[0] * stepsPerHour, candy.position[1] * 100]
    };
});

prepareLevel.body:
return _.extend({}, level, {
    populationCandies: transformers.prepareCandies(level.populationCandies, stepsPerHour),
    growthCandies: transformers.prepareCandies(level.growthCandies, stepsPerHour)
});

scaleCandies.body:
candies = RW.cloneData(candies);

_.each(candies, function(candy) {
    candy.position[1] /= 100; 
})

return candies;
